import { createRouter, createWebHistory } from 'vue-router'
import HomeMiami from '../views/HomeMiami.vue'
import JuinMiami from '../views/JuinMiami.vue'
import JuilletMiami from '../views/JuilletMiami1.vue'
import JuilletMiami1 from '../views/JuilletMiami1.vue'
import JuilletMiami2 from '../views/JuilletMiami2.vue'
import AoutMiami from '../views/AoutMiami.vue'


const routes = [
  {
    path: '/',
    name: 'home',
    // eslint-disable-next-line
    component: HomeMiami
  },
  {
    path: '/juin',
    name: 'juin',
    // eslint-disable-next-line
    component: JuinMiami
  },
  {
    path: '/juillet',
    name: 'juillet',
    // eslint-disable-next-line
    component: JuilletMiami
  },
  {
    path: '/1_07',
    name: 'JuilletMiami1',
    // eslint-disable-next-line
    component: JuilletMiami1
  },
  {
    path: '/2_07',
    name: 'JuilletMiami2',
    // eslint-disable-next-line
    component: JuilletMiami2
  },
  {
    path: '/aout',
    name: 'aout',
    // eslint-disable-next-line
    component: AoutMiami
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
